const e=JSON.parse('{"key":"v-3d95c4c0","path":"/zh/bank3/","title":"KDJ指标的基本运用","lang":"zh-CN","frontmatter":{"title":"KDJ指标的基本运用","icon":"page","order":3,"author":"涎涎","date":"2022-04-11T21:28:59.000Z","isOriginal":true,"permalinkPattern":"bank3","category":["bank"],"tag":["bank"],"head":[["meta",{"name":"keywords","content":"KDJ指标的基本运用"}],["meta",{"property":"og:url","content":"https://yanbo0039.github.io/blog/blog/zh/bank3/"}],["meta",{"property":"og:site_name","content":"涎涎的博客"}],["meta",{"property":"og:title","content":"KDJ指标的基本运用"}],["meta",{"property":"og:description","content":"KDJ指标的基本运用 KDJ指标又叫随机指标，是由乔治·蓝恩博士（George Lane）最早提出的，是一种相当新颖、实用的技术分析指标，是带杠杆和白银市场上最常用的技术分析工具。 AA随机指标KD最早是以KD指标的形式出现，而KD指标是在威廉指标的基础上发展起来的。不过威廉指标只判断白银的超买超卖现象，在KDJ指标中则融合了移动平均线速度上的观念，形成比较准确的买卖信号依据。在实践中，K线与D线配合J线组成KDJ指标来使用。由于KDJ线本质上是一个随机波动的观念，故其对于掌握中短期行情走势比较准确。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-05-28T05:50:51.000Z"}],["meta",{"property":"article:author","content":"涎涎"}],["meta",{"property":"article:tag","content":"bank"}],["meta",{"property":"article:published_time","content":"2022-04-11T21:28:59.000Z"}],["meta",{"property":"article:modified_time","content":"2023-05-28T05:50:51.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"KDJ指标的基本运用\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2022-04-11T21:28:59.000Z\\",\\"dateModified\\":\\"2023-05-28T05:50:51.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"涎涎\\"}]}"]],"description":"KDJ指标的基本运用 KDJ指标又叫随机指标，是由乔治·蓝恩博士（George Lane）最早提出的，是一种相当新颖、实用的技术分析指标，是带杠杆和白银市场上最常用的技术分析工具。 AA随机指标KD最早是以KD指标的形式出现，而KD指标是在威廉指标的基础上发展起来的。不过威廉指标只判断白银的超买超卖现象，在KDJ指标中则融合了移动平均线速度上的观念，形成比较准确的买卖信号依据。在实践中，K线与D线配合J线组成KDJ指标来使用。由于KDJ线本质上是一个随机波动的观念，故其对于掌握中短期行情走势比较准确。"},"headers":[],"git":{"createdTime":1684701424000,"updatedTime":1685253051000,"contributors":[{"name":"涎涎","email":"yanbo0039@yeah.net","commits":2}]},"readingTime":{"minutes":4.37,"words":1311},"filePathRelative":"zh/programBlog/ServerSideLanguage/bank/3-KDJ指标的基本运用.md","localizedDate":"2022年4月11日","excerpt":"<!-- more -->\\n<h1> KDJ指标的基本运用</h1>\\n<blockquote>\\n<p>KDJ指标又叫随机指标，是由乔治·蓝恩博士（George Lane）最早提出的，是一种相当新颖、实用的技术分析指标，是带杠杆和白银市场上最常用的技术分析工具。</p>\\n</blockquote>\\n<blockquote>\\n<p>AA随机指标KD最早是以KD指标的形式出现，而KD指标是在威廉指标的基础上发展起来的。不过威廉指标只判断白银的超买超卖现象，在KDJ指标中则融合了移动平均线速度上的观念，形成比较准确的买卖信号依据。在实践中，K线与D线配合J线组成KDJ指标来使用。由于KDJ线本质上是一个随机波动的观念，故其对于掌握中短期行情走势比较准确。</p>\\n</blockquote>","autoDesc":true}');export{e as data};
